import React from "react";
import Pipo from "./Pipo";
import Contacts from "./Contacts";

function createCard(contactt) {
  <Contacts contact={contactt.name} />;
}

function Maps() {
  return <div>Pipo.map(createCard);</div>;
}

export default Maps;
